--Setup
DECLARE @MaxPat bigint, 
@MaxPid bigint,
@MaxCar bigint,
@MaxCarId bigint, @RelID bigint

CREATE TABLE #Pat(PatientID_CDR BIGINT, 
EnterprisePatientId bigint, 
PatientId_Extension NVARCHAR(255))

--Create list of Patients to be removed
INSERT INTO #Pat
SELECT        PatientID_CDR, EnterprisePatientId, PatientId_Extension
FROM            MasterData.PatientIdentifier
WHERE        (PatientId_Extension LIKE N'PHA_EncAT%')

 
INSERT INTO #Pat
SELECT        PatientID_CDR, EnterprisePatientId, PatientId_Extension
FROM            MasterData.PatientIdentifier
WHERE        (PatientId_Extension LIKE N'PHA2_PBC_AT13_%')

--Create list of Providers to be removed

CREATE TABLE #CAR(CareProviderId_CDR BIGINT, 
EnterpriseProviderID bigint, 
CareProviderId_Extension NVARCHAR(255))

INSERT INTO #CAR
SELECT        CareProviderId_CDR, EnterpriseProviderID, CareProviderId_Extension
FROM            MasterData.CareProviderIdentifier
WHERE        (CareProviderId_Extension LIKE N'PHA_EncAT%')


---Patient clear & Insert
  
DELETE P FROM MasterData.Patient P
INNER JOIN  #Pat Pat
ON P.PatientID_CDR=Pat.PatientID_CDR

DELETE P FROM MasterData.Patient P
INNER JOIN  #Pat Pat
ON P.EnterprisePatientId=Pat.EnterprisePatientId

Delete dbmClinicalAnalyticsGateway.Fact.MetricsResults

